Fetch with cookie not working even with `credentials: 'include'`<p>I can't get fetch to send a cookie. I <a href="https://github.com/github/fetch#sending-cookies" rel="noreferrer">read</a> that for cross origin request, you must use <code>credentials: 'include'</code>. But this still isn't giving me cookies.</p>
<h2>Fetch html document</h2>
<pre class="lang-html prettyprint-override"><code>&lt;!DOCTYPE html&gt;
&lt;html lang=&quot;en&quot;&gt;
  &lt;head&gt;
    &lt;meta charset=&quot;UTF-8&quot; /&gt;
    &lt;meta name=&quot;viewport&quot; content=&quot;width=device-width, initial-scale=1.0&quot; /&gt;
    &lt;title&gt;Document&lt;/title&gt;
  &lt;/head&gt;
  &lt;body&gt;
    &lt;div&gt;fetch on load&lt;/div&gt;
    &lt;script&gt;
      fetch('http://localhost:4001/sayhi', { credentials: 'include' })
        .then((res) =&gt; {
          return res.text();
        })
        .then((text) =&gt; {
          console.log('fetched: ' + text);
        })
        .catch(console.log);
    &lt;/script&gt;
  &lt;/body&gt;
&lt;/html&gt;

</code></pre>
<h2>Server file:</h2>
<pre class="lang-js prettyprint-override"><code>const express = require('express');
const mongoose = require('mongoose');

const session = require('express-session');
const MongoStore = require('connect-mongo')(session);

const app = express();
const cors = require('cors');

app.use(cors());
app.use((req, res, next) =&gt; {
  console.log(req.path);

  // this will log a cookie when several 
  // requests are sent through the browser 
  // but 'undefined' through `fetch`
  console.log('cookie in header: ', req.headers.cookie);

  next();
});

app.use(
  session({
    secret: 'very secret 12345',
    resave: true,
    saveUninitialized: false,
    store: new MongoStore({ mongooseConnection: mongoose.connection }),
  })
);

app.use(async (req, res, next) =&gt; {
  console.log(`${req.method}: ${req.path}`);
  try {
    req.session.visits = req.session.visits ? req.session.visits + 1 : 1;
    return next();
  } catch (err) {
    return next(err);
  }
});

app.get('/sayhi', (req, res, next) =&gt; {
  res.send('hey');
});

(async () =&gt;
  mongoose.connect('mongodb://localhost/oneSession', {
    useNewUrlParser: true,
    useUnifiedTopology: true,
    useFindAndModify: true,
  }))()
  .then(() =&gt; {
    console.log(`Connected to MongoDB set user test`);
    app.listen(4001).on('listening', () =&gt; {
      console.log('info', `HTTP server listening on port 4001`);
    });
  })
  .catch((err) =&gt; {
    console.error(err);
  });
</code></pre>
<p>The middleware that runs <code>console.log('cookie in header: ', req.headers.cookie);</code> returns undefined for every fetch request.</p>
<p>Every fetch request is also creating a new session, I believe because the cookie isn't being set.</p>
<p>How can I get cookies to send with fetch?</p>
<h2>Update: Partial answer</h2>
<p>I think adding these helped so far:</p>
<pre><code>//instead of app.use(cors());
app.use(
  cors({
    credentials: true,
    origin: 'http://localhost:5501', // your_frontend_domain, it's an example
  })
);

app.use((req, res, next) =&gt; {
   `res.header('Access-Control-Allow-Credentials', true);   
   res.header('Access-Control-Allow-Origin', 'http://127.0.0.1:5501');` // your_frontend_domain, it's an example
   next()
});

</code></pre>
<p>But I still have a problem:</p>
<p>In devtools, I went to 'Network' and refreshed the html file to send the request again. There I saw the response headers. I could see that the Set-Cookie header was sent but had a yellow triangle warning.</p>
<p><a href="https://i.stack.imgur.com/Dgjfb.png" rel="noreferrer"><img src="https://i.stack.imgur.com/Dgjfb.png" alt="enter image description here" /></a></p>
<p>It says to set <code>sameSite</code> to <code>true</code>.</p>
<p>I needed to add <code>cookie: { sameSite: 'none' }</code> to the session options</p>
<pre class="lang-js prettyprint-override"><code>app.use(
  session({
    secret: 'very secret 12345',
    resave: true,
    cookie: { sameSite: 'none' },
    saveUninitialized: false,
    store: new MongoStore({ mongooseConnection: mongoose.connection }),
  })
);
</code></pre>
<p>After I did that I got a new yellow triangle warning by the cookie that said I needed to set another option on cookie- <code>secure: true</code>. But this means only requests that send over HTTPS will work. But I'm in development and can't send over https.</p>

